import React from "react";
import OtherLayout from '../components/OtherLayout';
import Head from "next/head";

const Contact = () => {
    return(
        <>
            <Head>
                <title>Study Board | Contact </title>
            </Head>
            <OtherLayout>
                <div>Contact </div>
            </OtherLayout>
        </>
    )
};

export default Contact
